import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import RegisterUser from './components/RegisterUser';
import BookFlight from './components/BookFlight';
import SearchFlights from './components/SearchFlights';
import GetBookingById from './components/GetBookingById';
import GetAllBookings from './components/GetAllBookings';
import GetFlightById from './components/GetFlightById';
import GetAllFlights from './components/GetAllFlights';

const App: React.FC = () => {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li><Link to="/register">Register User</Link></li>
            <li><Link to="/book-flight">Book Flight</Link></li>
            <li><Link to="/search-flights">Search Flights</Link></li>
            <li><Link to="/get-booking/1">Get Booking by ID</Link></li>
            <li><Link to="/get-all-bookings">Get All Bookings</Link></li>
            <li><Link to="/get-flight/1">Get Flight by ID</Link></li>
            <li><Link to="/get-all-flights">Get All Flights</Link></li>
          </ul>
        </nav>
        <Routes>
          <Route path="/register" element={<RegisterUser />} />
          <Route path="/book-flight" element={<BookFlight />} />
          <Route path="/search-flights" element={<SearchFlights />} />
          <Route path="/get-booking/:id" element={<GetBookingById />} />
          <Route path="/get-all-bookings" element={<GetAllBookings />} />
          <Route path="/get-flight/:id" element={<GetFlightById />} />
          <Route path="/get-all-flights" element={<GetAllFlights />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
